import React from "react";
import "./OurService.css";
import IMG from "./img/IMG1.png";

function OurService() {
  return (
    <div>
      <div className="heading">Our Service</div>
      <div className="heading2">
        Taking high level concepts & turning them <br />
        into functional, engaging products.
      </div>
      <div className="para">
        The breadth and depth of our experience allows us to create tailor-made
        userxs
        <br /> interface design that lead to increased user retention,
        engagement & loyality.
      </div>
    </div>
  );
}

export default OurService;
